const INITIAL_STATE = {
  data: [],
};

export default function DevicesIDReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
    case "FETCH_DEVICES_ID":
      
      return {
        ...state,
        data: action.payload,
      };
    default:
      return state;
  }
}
